import { expect } from 'chai';
import 'mocha';

import {
  encode64,
  decode64,
  TransactionPack,
  Contract,
  RoleSimple,
  ChangeOwnerPermission,
  KeyAddress,
  Boss,
  PublicKey
} from '../src';

const pack1BIN = decode64("");
const pack2BIN = decode64("");

describe('Contract', () => {
  it('should read contract', async () => {
    const tpack = Boss.load(pack1BIN) as TransactionPack;
    const contract = tpack.contract;
    const owner = contract.owner as RoleSimple;
    const creator = contract.creator;
    const issuer = contract.issuer;

    const permissions = contract.definition.permissions;

    expect(issuer.name).to.equal("issuer");
    expect(owner instanceof RoleSimple).to.equal(true);
    expect(owner.addresses[0] instanceof KeyAddress).to.equal(true);
    expect(permissions['vb5KyA'] instanceof ChangeOwnerPermission).to.equal(true);
    expect(contract.definition.data.ticker).to.equal("UTN");
    expect(contract.state.branchId).to.equal('1739:0');
    expect(contract.state.revision).to.equal(1739);
    expect(contract.state.data.amount).to.equal('4.3062999998');
  });

  it('should read signatures', async () => {
    const tpack = Boss.load(pack1BIN) as TransactionPack;
    const contract = tpack.contract;
    const keys = await contract.getSignatureKeys();

    expect(keys[0] instanceof PublicKey).to.equal(true);
  });

  // it('should read permi')

  // it('should create new contract');
});
